// src/App.js
import React from "react";
import { Routes, Route } from "react-router-dom";

import "./App.css";

import Start from "./pages/Start";
import Learn from "./pages/Learn";          // 학습 페이지
import Exam from "./pages/Exam";            // 말하기 시험
import Records from "./pages/Records";      // 기록 보기
import Badges from "./pages/Badges";        // 뱃지 보관함(관리자)
import AdminLogin from "./pages/AdminLogin";// 관리자 로그인
import Result from "./pages/Result";        // 결과 페이지

function App() {
  return (
    <Routes>
      <Route path="/" element={<Start />} />
      <Route path="/learn/:day" element={<Learn />} />
      <Route path="/exam/:day" element={<Exam />} />
      <Route path="/result" element={<Result />} />
      <Route path="/records" element={<Records />} />
      <Route path="/badges" element={<Badges />} />
      <Route path="/admin" element={<AdminLogin />} />
      <Route path="*" element={<Start />} />
    </Routes>
  );
}

export default App;
